import React from 'react';
import { MemberCard } from './MemberCard.js';
import { EventGoalCard } from './EventGoalCard.js';
import '../../css/footer.css';

function createRandomCards(type, totalSame, totalAll){
  let cards = [...Array(totalSame)].map((curr, index)=>{
    let randomLeft = Math.round((Math.random() * 10 - 5) + (index)*(100/6));
    let randomBottom = Math.round(Math.random() * 100);
    let randomZ = Math.round(Math.random() * totalAll);
    switch (type) {
      case "member":
        return (
          <MemberCard
            key={"memberCard" + index}
            left={randomLeft}
            bottom={randomBottom}
            z={randomZ}
          />
        )
      default:
        return (
          <EventGoalCard
            type={type}
            key={type + "Card" + index}
            left={randomLeft}
            bottom={randomBottom}
            z={randomZ}
          />
        )
    }
  });
  return cards;
}

const Footer = () => {
  let totalMemberCards = 6;
  let totalGoalCards = 3;
  let totalEventCards = 3;
  let totalCards = totalMemberCards + totalEventCards + totalGoalCards;

  let memberCards = createRandomCards("member", totalMemberCards, totalCards);
  let goalCards = createRandomCards("goal", totalGoalCards, totalCards);
  let eventCards = createRandomCards("event", totalEventCards, totalCards);

  return (
    <div>
      {memberCards}
      {goalCards}
      {eventCards}
    </div>
  )
}

export default Footer;
